import React from 'react';

function App() {
  return (
    <div className="App">
      <Header />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>This is awesome.</h1>
      </header>
    </div>
  );
}

export default App;
